    false,nt"url": null,nt"notes": "The imagery posted on this site is of the
    Florida panhandle and surrounding regions after Hurricane Dennis made landfall.
    The regions photographed range from Pensacola to Panama City, Florida. The aerial
    photograph missions were conducted by the NOAA Remote Sensing Division the day after
    Dennis made landfall, July 11 and concluded July 13. The images were acquired from
    an altitude of 7,500 feet, using an Emerge/Applanix Digital Sensor System (DSS).
    A total of 1,003 aerial images were obtained during this time period, with most
    available to view online and download.",nt"license_title": null,nt"extras":
